const url_login = "http://localhost:5000/login";

export async function nuevousuario(usuario,password){
    return fetch(url_login,{
    method: "POST",
        headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      } ,
      body: JSON.stringify({
        usuario: usuario,
        password:password
      }),
    });
  }
